    "full_text" : "on a similar note, I regret all of the times I gave a talk and didn't subsequently review it. I don't even have all of the slides I've used. How is that possible...? I think some of them were on my work account. \n\nif you give a talk anywhere ever, take 5m to journal afterwards",
