    "full_text" : "by \"keep your frames sharp\" I mean developing rigorous answers to things like \"what are you working on? what are you curious about? what are opportunities you'd like? how can you prepare for them?\"\n\nI love being a lazy arse, but one can also be a *sharp* lazy arse",
