    "favorited" : false,
    "full_text" : "You don‚Äôt need to be antagonistic to be unpleasant. There are many specialisations you can take in your quest to be insufferable. But what they all have in common, I think, is a lack of consideration for the other person. An inconsiderate friend can do more damage than a nemesis",
    "lang" : "en",
