    "in_reply_to_status_id" : "1183625334781988865",
    "created_at" : "Mon Oct 14 06:13:31 +0000 2019",
    "favorited" : false,
    "full_text" : "The ‚Äúproblem‚Äù is that these people would rather be right than make friends. The two aren‚Äôt mutually exclusive, but their priority is being right. so almost nobody wants to be friends with them, except other adversarial nitpickers like themselves, whose love language is ‚Äúfuck you‚Äù",
