    "created_at" : "Fri May 08 14:58:05 +0000 2020",
    "favorited" : false,
    "full_text" : "A specific class of dysfunction I‚Äôve noticed is when a person insists that their own questions are good-faith, but other people asking them questions = bad faith. It can be a kind of hypocrisy that‚Äôs hard for the individual to live with; the tension has consequences *somewhere*",
